description:
Remember when you were saved by Jesus, your first love? Our study begins in Revelation 1:20 where Jesus is in the midst of the seven churches,holding seven stars in His right hand. Consider what this means as we are introduced to the first of the seven churches, the church of Ephesus. Learn from Jesus' commendations and correction, remembering the steadfast love and grace of Jesus - our first love!

Athey Creek Christian Fellowship is a body of believers in Wilsonville Oregon desiring to know the Lord in an ever-increasing measure. We are a non-denominational fellowship associating with all who are in the Body of Christ.  
